package dev.puzzles.geek4geeks.goldman;

import java.util.LinkedHashMap;
import java.util.LinkedHashSet;
import java.util.Map;
import java.util.Set;

//https://practice.geeksforgeeks.org/problems/non-repeating-character-1587115620/1#
public class NonRepeatingFirstCharacter {

    static char nonrepeatingCharacter_first(String s)
    {
        //Your code here
        char ch_out = '$';
        if (s != null && s.length() > 0) {
            char [] ch = s.toCharArray();
            Map<Character, Boolean> map = new LinkedHashMap<>(); // Note: Hashmap would have disturbed the order. LinkedHashmap would maintain the order.
            for (Character ch1: ch) {
                if (map.containsKey(ch1)) {
                    map.put(ch1, false);
                } else {
                    map.put(ch1, true);
                }
            }

            for (Map.Entry<Character, Boolean> entry: map.entrySet()) {
                if (entry.getValue() == true) {
                    ch_out = entry.getKey();
                    break;
                }
            }

        }
        return ch_out;
    }

    static char nonrepeatingCharacter_second(String s) {
        //Your code here
        char ch_out = '$';
        if (s != null && s.length() > 0 && s.length() <= Math.pow(10,3)) {
            char[] ch = s.toCharArray();
            Set<Character> uniqueSet = new LinkedHashSet<>();
            Set<Character> removedSet = new LinkedHashSet<>();
            for (Character ch1: ch) {
                if (uniqueSet.contains(ch1) || removedSet.contains(ch1)) {
                    uniqueSet.remove(ch1);
                    removedSet.add(ch1);
                } else {
                    uniqueSet.add(ch1);
                }
            }

            if (!uniqueSet.isEmpty()) {
                ch_out = uniqueSet.iterator().next();
            }
        }
        return ch_out;
    }

    public static void main(String[] args) {
        System.out.println(nonrepeatingCharacter_first(""));
        System.out.println(nonrepeatingCharacter_second(""));
    }
}
